export const Events = (props) => {
    return (
        <div className="container events">
            <div className="row">
            <h1 style={{textAlign: 'center', margin: '2em 1em 1em 1em', color: '#6372ff'}}>EVENTS</h1>
            <ul className="events">
                {props.data
                ? props.data.map((d, i) => (
                   <li className="col-xs-6 col-sm-4">{d}</li>
                ))
                : 'loading'}
            </ul>
            </div>
        </div>
    );
};
